import React from "react";
import './App.css';
import images from './components/img.js'
import header from './components/header.js';   
import card from './components/card.js';



function App() {
  return (
    <div class="container">
      {header()}
      <main>
        <div class="row">
          <div class="col">
            <nav class="navbar navbar-light bg-light">
              <div class="container-fluid">
                <a class="navbar-brand">
                <img src={images.menu} width="40px" height="40px" />
                </a>
                <form class="d-flex">
                  <input class="form-control me-2" type="search" placeholder="Адрес" aria-label="Search" />
                  <button class="btn btn-outline-success" type="submit">Поиск</button>
                </form>
              </div>
            </nav>
            {card()}

          </div>
          <div class="col">
            <img src="https://открыватор.москва/file/2015/10/karta-moskvi.jpg" height="400px" />
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
